//   <ul>
//     <li>One</li>
//     <li>Two</li>
//     <li>Three</li>
//   </ul>
// </div>
// , document.getElementById("root"));

const root = ReactDOM.render(document.getElementById("root"));
root.render(
  <div>
    <h1>Test</h1>
    <p>
      Lorem ipsum dolor sit amet consectetur adipisicing elit. Officia natus non
      id error dolori
    </p>
    <ul>
      <li>One</li>
      <li>Two</li>
      <li>Three</li>
    </ul>
  </div>
);
